import React from "react";
import ReactDOM from "react-dom";
import Card from "./Cards";
import './index.css';
import Sdata from "./Sdata";

// function ncard(val){

// }


ReactDOM.render(
  <>
  <h1 className="heading_style"> List Of Top 5 Netflix Series in 2020</h1>
   {Sdata.map((val) => {

    return (
      <Card 
         imgsrc={val.imgsrc}
         sname={val.sname}
         title={val.title}
         link={val.link} 
       />
    );

   })}
  </>,
document.getElementById("root")
);
